import React, { useState, useEffect } from 'react';
import { Route, Routes, useLocation } from 'react-router-dom';
import axios from 'axios';
import Home from './components/Home';
import Login from './components/Login';
import Register from './components/Register';
import ArtworkList from './components/ArtworkList';
import AdminHomePage from './Admin/AdminHomePage';
import ArtistHomePage from './Artist/ArtistHomePage';
import CuratorHomePage from './Curator/CuratorDashboard';
import VisitorHomePage from './Visitor/VisitorHomePage';
import CartPage from './components/CartPage';
import AboutPage from './components/About';
import ProfilePage from './components/ProfilePage'; // New Profile Page

// Import Navbars
import Navbar from './components/Navbar';
import AdminNavbar from './components/AdminNavbar';
import ArtistNavbar from './components/ArtistNavbar';
import CuratorNavbar from './components/CuratorNavbar';
import AddArtwork from './Artist/AddArts';
import MyArtworks from './Artist/Myartworks';

const App = () => {
  const [cartItems, setCartItems] = useState([]);
  const [userData, setUserData] = useState(null); // User data from backend
  const location = useLocation();

  // Fetch user data after login
  useEffect(() => {
    const fetchUserData = async () => {
      try {
        const userId = localStorage.getItem('userId'); // Assuming you store user ID after login
        if (!userId) return; // No user logged in

        const response = await axios.get(`http://localhost:8080/api/users/${userId}`);
        setUserData(response.data);
      } catch (error) {
        console.error('Failed to fetch user data:', error);
      }
    };

    fetchUserData();
  }, []);

  // Dynamic Navbar
  const getNavbar = () => {
    if (!userData) return null;
    const { role } = userData;

    switch (role) {
      case 'ADMIN':
        return <AdminNavbar />;
      case 'ARTIST':
        return <ArtistNavbar />;
      case 'CURATOR':
        return <CuratorNavbar />;
      default:
        return <Navbar />;
    }
  };

  return (
    <div>
      {getNavbar()} {/* Show appropriate navbar */}
      <Routes>
        {/* Main Routes */}
        <Route path="/" element={<Home />} />
        <Route path="/about" element={<AboutPage />} />
        <Route path="/login" element={<Login />} />
        <Route path="/register" element={<Register />} />
        <Route path="/artworks" element={<ArtworkList setCartItems={setCartItems} cartItems={cartItems} />} />
        <Route path="/cart" element={<CartPage cartItems={cartItems} setCartItems={setCartItems} />} />

        {/* Profile Route */}
        {userData && (
          <Route
            path={`/profile/${userData.id}`}
            element={<ProfilePage userData={userData} setUserData={setUserData} />}
          />
        )}

        {/* Admin Routes */}
        {userData && userData.role === 'ADMIN' && (
          <Route path="/admin" element={<AdminHomePage />} />
        )}

        {/* Artist Routes */}
        {userData && userData.role === 'ARTIST' && (
          <>
            <Route path={`/artist/${userData.id}`} element={<ArtistHomePage />} />
            <Route path={`/artist/${userData.id}/addartwork`} element={<AddArtwork />} />
            <Route path={`/artist/${userData.id}/myartworks`} element={<MyArtworks />} />
          </>
        )}

        {/* Curator Routes */}
        {userData && userData.role === 'CURATOR' && (
          <Route path="/curator" element={<CuratorHomePage />} />
        )}

        {/* Visitor Routes */}
        {userData && userData.role === 'VISITOR' && (
          <Route path={`/visitor/${userData.id}`} element={<VisitorHomePage />} />
        )}
      </Routes>

      {/* Footer */}
      <footer style={{ textAlign: 'center', marginTop: '20px', padding: '10px', backgroundColor: '#f8f9fa' }}>
        <p>&copy; {new Date().getFullYear()} Art Gallery. All rights reserved.</p>
      </footer>
    </div>
  );
};

export default App;
